import { MainPage } from "../MainPage";
import styles from "./Header.module.css"

export const Header = () => {
    return (<ul className="header">
        <li><a href="/">Login</a></li>
        <li><a href="/">Register</a></li>
        <li><a href="/">About Us</a></li>
        <li><a href="/">Contact Us</a></li>
    </ul>)

}
